import React, {Component} from 'react';



class Profile extends Component {
    render() {
      return (
        <div className="profile">
            <div>
                <img id="pandaGirl" src="https://www.trickscity.com/wp-content/uploads/2017/09/cute-profile-pics-for-whatsapp-images.png" alt="profile pic 1" />
            </div>
        </div>
      )
    }
}

export default Profile;
